import React from 'react';
import './Sidebar.css';

class Sidebar extends React.Component{
    render(){
        return(
        <div className = "Sidebar">
            <div className ="Searchbar-options">
                <ul className = "nav nav-tabs">
                    <a href="#">About Me</a>
                    <a href="#">Tinder Case Study</a>
                    <a href="#">Panasonic Internship</a>
                    <a href="#">CoreLogic Internship</a>
                    <a href="#">Side Projects</a>
                </ul>
            </div>
        </div>
        )
    }
}

export default Sidebar;
